// import logo from './logo.svg';
import "./App.css";
import Home from "./Component/Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./Component/Navbar";
import MovieList from "./Component/MovieList";
import MovieCategory from "./Component/MovieCategory";

function App() {
    return ( <
        >
        <
        Router >
        <
        Navbar / >
        <
        Routes >
        <
        Route exact path = "/"
        element = { < Home / > }
        />{" "} <
        Route exact path = "/movies/popular"
        element = { < MovieList key = "popular"
            category = "popular" / > }
        />{" "} <
        Route exact path = "/movies/toprated"
        element = { < MovieList key = "top_rated"
            category = "top_rated" / > }
        />{" "} <
        Route exact path = "/movies/upcoming"
        element = { < MovieList key = "upcoming"
            category = "upcoming" / > }
        />{" "} <
        Route exact path = "/movies/bollywood"
        element = { <
            MovieCategory
            with_original_language = "hi|kn|ml|ta|te"
            category = "Bollywood" /
            >
        }
        />{" "} <
        Route exact path = "/movies/hollywood"
        element = { <
            MovieCategory
            with_original_language = "AU|CA|GB|IE|NZ|US"
            category = "hollywood" /
            >
        }
        />{" "} <
        /Routes>{" "} <
        /Router>{" "} <
        />
    );
}

export default App;
